         rmoperator(3) = x*rmoperator(1)
         imoperator(3) = y*rmoperator(1)
      elseif(nmultipoles.lt.0) then
         call bummer('fmmmoperator: error, nmultipoles = ',nmultipoles)
      endif
      return
      end subroutine fmmmoperator
#endif
